import React from "react";
import { useState } from "react";

function Box() {
  const [getColor, setColor] = useState("black");

  function changecolor() {
    setColor("white");
  }

  return (
    <div
      onClick={changecolor}
      style={{ background: { getColor } }}
      className="box a"
    >
      A
    </div>
  );
}

export default Box;
